('000000000000001', 3, 27, 3, 1, 3, 'ECOGRAFIA ABDOMEN TOTAL', 'HIGADO: TAMA?O: NORMAL (MEDIDA AP EN L?NEA HEP?TICA MEDIA: 162MM. MEDIDA AP L?BULO IZQUIERDO: 75MM). LA TEXTURA ECOGR?FICA DEL PAR?NQUIMA ES HOMOG?NEA Y USUAL, SIN IM?GENES PATOL?GICAS DE TIPO FOCAL NI DIFUSO. HUBO SATISFACTORIA VISUALIZACI?N DEL HEMIDIAFRAGMA DERECHO Y DE LA VASCULATURA INTRAHEP?TIC\r\n\r\nRI?ONES: DE TAMA?O, FORMA Y TEXTURA ECOGR?FICA NORMALES. GROSOR DEL PAR?NQUIMA NORMAL. INTERFASE PAR?NQUIMA/SENO Y CORTICOMEDULAR EVIDENCIABLES. SIN IM?GENES PATOL?GICAS ECOGR?FICAMENTE REGISTRABLES.', '2016-09-03 10:55:39'),
('000000000000002', 3, 27, 4, 1, 1, 'ECOGRAFIA ABDOMEN TOTAL', 'HIGADO: TAMA?O: NORMAL (MEDIDA AP EN L?NEA HEP?TICA MEDIA: 162MM. MEDIDA AP L?BULO IZQUIERDO: 75MM). LA TEXTURA ECOGR?FICA DEL PAR?NQUIMA ES HOMOG?NEA Y USUAL, SIN IM?GENES PATOL?GICAS DE TIPO FOCAL NI DIFUSO. HUBO SATISFACTORIA VISUALIZACI?N DEL HEMIDIAFRAGMA DERECHO Y DE LA VASCULATURA INTRAHEP?TICA\r\n\r\nVESICULA: COMPRESIBLE, DE PAREDES REGULARES, LISAS Y 1.2 DE GROSOR. SIN SIGNO DE MURPHY SONOGR?FICO. DI?METRO TRANSVERSO DE VES?CULA: 21MM; LONGITUDINAL 62MM. NO PRESENTA IM?GENES PATOL?GICAS EN SU INTERIOR ECOGR?FICAMENTE REGISTRABLES. \r\n\r\nVIA BILIAR INTRAHEPATICA: NO DILATADA. \r\n\r\nVIA BILIAR EXTRAHEPATICA: NO DILATADA. DI?METRO DEL CONDUCTO COL?DOCO: 4.1MM. NO SE EVIDENCIAN IM?GENES PATOL?GICAS EN LA V?A BILIAR.\r\n\r\nPANCREAS: LA PORCI?N VISUALIZADA ES DE TAMA?O NORMAL (DI?METRO AP EN CABEZA MM, CUERPO MM, COLA MM), CON FORMA USUAL Y TEXTURA ECOGR?FICA HOMOG?NEA. NO HAY EVIDENCIA DE CALCIFICACIONES. CONDUCTO PANCRE?TICO PRINCIPAL NO DILATADO (1MM DE DI?METRO ANTEROPOSTERIOR)..\r\n\r\nBAZO: DE TAMA?O NORMAL,CON FORMA USUAL Y TEXTURA ECOGR?FICA HOMOG?NEA.\r\n\r\nRI?ONES: DE TAMA?O, FORMA Y TEXTURA ECOGR?FICA NORMALES. GROSOR DEL PAR?NQUIMA NORMAL. INTERFASE PAR?NQUIMA/SENO Y CORTICOMEDULAR EVIDENCIABLES. SIN IM?GENES PATOL?GICAS ECOGR?FICAMENTE REGISTRABLES.\r\n\r\nVEJIGA: SATISFACTORIAMENTE DISTENDIDA, DE PAREDES NORMALES Y SIN IM?GENES PATOL?GICAS EVIDENCIABLES EN SU INTERIOR.\r\n\r\nPROSTATA: SUS MEDIDAS FUERON (DI?METROS LONGITUDINAL, TRANSVERSO Y ANTEROPOSTERIOR) DE 38X44X30MM. VOLUMEN APROXIMADO DE 18CC (NORMAL HASTA 20CC). CONTORNOS REGULARES. TEXTURA ECOGR?FICA HOMOG?NEA Y USUAL; NO SE OBSERVARON IM?GENES PATOL?GICAS DE TIPO FOCAL NI DIFUSO.\r\n\r\nOBSERVACIONES: \r\nCONTENIDO GASTRODUODENAL EN APRECIABLE CANTIDAD. EXISTE MODERADA CANTIDAD DE GAS INTESTINAL. NO ACUS? DOLOR AL PASO DEL TRANSDUCTOR EN ABDOMEN NI PELVIS. NO HAY IM?GENES AGREGADAS SUGESTIVAS DE MASAS O COLECCIONES ABDOMINALES APARENTES. \r\n\r\nI.DX. \r\n1.	NO SE OBSERVARON IM?GENES PATOL?GICAS EN ABDOMEN NI PELVIS, ECOGR?FICAMENTE REGISTRABLES DURANTE ESTE EXAMEN. ', '2016-09-03 12:54:39'),
('000000000000003', 3, 27, 5, 1, 1, 'ECOGRAFIA TEJIDOS BLANDOS DE CUELLO', 'PIEL Y TEJIDO CELULAR SUBCUTANEO: PRESENTAN TEXTURA ECOGR?FICA HABITUAL, SIN IM?GENES PATOL?GICAS EVIDENCIABLES.\r\n\r\nGLANDULAS SUBMAXILARES Y PAR?TIDAS: DE TAMA?O, FORMA Y TEXTURA ECOGR?FICA HABITUALES. NO PRESENTAN IM?GENES PATOL?GICAS AGREGADAS DE TIPO FOCAL NI DIFUSO.\r\n\r\nGLANDULA TIROIDES:\r\nL?BULO DERECHO: TAMA?O : NORMAL. \r\nDI?METRO LONGITUDINAL:	29	MM.	A.P.:	10	MM.	DI?METRO TRANS:8MM	 \r\nVOLUMEN LOB: 3.1CC. 		\r\n					\r\nTEXTURA ECOGR?FICA: HOMOG?NEA Y USUAL, SIN APARENTES IM?GENES AGREGADAS DE TIPO NODULAR.\r\n L?BULO IZQUIERDO: TAMA?O : NORMAL.\r\nDI?METRO LONGITUDINAL:	29	MM.	A.P.:	11	MM.	DI?METRO TRANS:7MM 	 \r\nVOLUMEN LOB: 2.8CC	\r\n	 					\r\nTEXTURA ECOGR?FICA: HOMOG?NEA Y USUAL, SIN IM?GENES AGREGADAS APARENTES DE TIPO NODULAR.\r\nISTMO: SIN MASAS PATOL?GICAS, ECOGR?FICAMENTE REGISTRABLES.\r\nVOLUMETRIA TOTAL DEL TIROIDES : 2.6CC (NORMAL EN LA MUJER HASTA 8.5CC).\r\n\r\nVASOS DEL CUELLO: SU CALIBRE Y DISPOSICI?N SON NORMALES. \r\n\r\nOBSERVACIONES: NO SE OBSERVARON EN CUELLO IM?GENES PATOL?GICAS SUGESTIVAS DE MASAS, COLECCIONES NI ADENOPAT?AS. SE REALIZ? EXAMEN CON TRANSDUCTOR LINEAL DE 7.5 MHZ.\r\n\r\nI.D.: NO SE OBSERVARON EN CUELLO IM?GENES PATOL?GICAS, ECOGR?FICAMENTE REGISTRABLES DURANTE ESTE EXAMEN.', '2016-09-03 01:10:36'),
('000000000000004', 3, 202, 124, 1, 3, 'ECOGRAFIA ABDOMEN TOTAL', 'HIGADO: TAMA?O: NORMAL (MEDIDA AP EN L?NEA HEP?TICA MEDIA: 129MM. MEDIDA AP L?BULO IZQUIERDO: 64MM). LA TEXTURA ECOGR?FICA DEL PAR?NQUIMA ES HOMOG?NEA Y USUAL, SIN IM?GENES PATOL?GICAS DE TIPO FOCAL NI DIFUSO. HUBO SATISFACTORIA VISUALIZACI?N DEL HEMIDIAFRAGMA DERECHO Y DE LA VASCULATURA INTRAHEP?TICA\r\n\r\nVESICULA: COMPRESIBLE, DE PAREDES REGULARES, LISAS Y 1.2 DE GROSOR. SIN SIGNO DE MURPHY SONOGR?FICO. DI?METRO TRANSVERSO DE VES?CULA: 27MM; LONGITUDINAL 60MM. NO PRESENTA IM?GENES PATOL?GICAS EN SU INTERIOR ECOGR?FICAMENTE REGISTRABLES. \r\n\r\nVIA BILIAR INTRAHEPATICA: NO DILATADA. \r\n\r\nVIA BILIAR EXTRAHEPATICA: NO DILATADA. DI?METRO DEL CONDUCTO COL?DOCO: 3.6MM. NO SE EVIDENCIAN IM?GENES PATOL?GICAS EN LA V?A BILIAR.\r\n\r\nPANCREAS: LA PORCI?N VISUALIZADA ES DE TAMA?O NORMAL (DI?METRO AP EN CABEZA 20MM, CUERPO 10MM, COLA NO VISUALIZADA), CON FORMA USUAL Y TEXTURA ECOGR?FICA HOMOG?NEA. NO HAY EVIDENCIA DE CALCIFICACIONES. CONDUCTO PANCRE?TICO PRINCIPAL NO DILATADO (1MM DE DI?METRO ANTEROPOSTERIOR)..\r\n\r\nBAZO: DE TAMA?O NORMAL,CON FORMA USUAL Y TEXTURA ECOGR?FICA HOMOG?NEA.\r\n\r\nRI?ONES: DE TAMA?O, FORMA Y TEXTURA ECOGR?FICA NORMALES. GROSOR DEL PAR?NQUIMA NORMAL. INTERFASE PAR?NQUIMA/SENO Y CORTICOMEDULAR EVIDENCIABLES. SIN IM?GENES PATOL?GICAS ECOGR?FICAMENTE REGISTRABLES.\r\n\r\nVEJIGA: SATISFACTORIAMENTE DISTENDIDA, DE PAREDES NORMALES Y SIN IM?GENES PATOL?GICAS EVIDENCIABLES EN SU INTERIOR.\r\n\r\n\r\nPROSTATA: SUS MEDIDAS FUERON (DI?METROS LONGITUDINAL, TRANSVERSO Y ANTEROPOSTERIOR) DE 18X25X18MM. VOLUMEN APROXIMADO DE 2.9CC (NORMAL HASTA 20CC). CONTORNOS REGULARES. TEXTURA ECOGR?FICA HOMOG?NEA Y USUAL; NO SE OBSERVARON IM?GENES PATOL?GICAS DE TIPO FOCAL NI DIFUSO.\r\n\r\n\r\nOBSERVACIONES: \r\nCONTENIDO GASTRODUODENAL EN MODERABLE CANTIDAD. EXISTE MODERADA CANTIDAD DE GAS INTESTINAL. ACUS? DOLOR AL PASO DEL TRANSDUCTOR EN FLANCO Y FOSA ILIACO DERECHOS. NO HAY IM?GENES AGREGADAS SU