('000000000000016', 3, 185, 112, 1, 3, 'ECOGRAFIA RENAL Y VIAS URINARIAS ', 'RESPETADO DR:\r\nEL ESTUDIO ECOGR?FICO PRACTICADO A SU PACIENTE EVIDENCI?:\r\n\r\nRI?ONES:\r\n\r\n RI?ON IZQUIERDO PRESENTA TAMA?O NORMAL (DI?METROS LONGITUDINAL , TRANSVERSO Y ANTEROPOSTERIOR DE 102X60X47MM; EL DERECHO ES DE PEQUE?O TAMA?O (71X50X44MM).LAS SILUETAS RENALES PRESENTAN DISCRETA IRREGULARIDAD. EL RI?ON DERECHO ES DE UBICACION MAS INTERNA E INFERIOR DE LO USUAL. \r\n\r\nBILATERALMENTE SE OBSERVO AUMENTO DIFUSO EN LA ECOGENICIDAD DEL PARENQUIMA, CON DISMINUCION EN LA VISUALIZACION DE LA INTERFASE CORTICOMEDULAR. \r\n\r\nECOS CENTRALES PARCIALMENTE BORRADOS BILATERALMENTE POR PIELECTASIA. NO SE EVIDENCIARON OTRAS IM?GENES PATOL?GICAS EN SENO NI EN PAR?NQUIMA. \r\n\r\nAMBOS RI?ONES EXCURSIONAN NORMALMENTE CON LOS MOVIMIENTOS RESPIRATORIOS Y NO SE EVIDENCIARON IM?GENES AGREGADAS PERI-RENALES APARENTES.\r\n\r\nNO HAY SIGNOS DE DILATACI?N APARENTE DE LA V?A URINARIA DISTAL.\r\n\r\n\r\nVEJIGA:\r\n\r\nLA VEJIGA PRESENTA SATISFACTORIAMENTE DISTENSI?N, PAREDES IRREGULARES DE CALIBRE Y ECOGENICIDAD AUMENTADOS Y NO SE OBSERVARON IM?GENES PATOL?GICAS EN SU INTERIOR; PRESENTA BALON INFLADO DE SONDA\r\nVOLUMEN VESICAL PREMICCIONAL APROXIMADO 353CC.\r\n\r\nPROSTATA:\r\n\r\nGL?NDULA PROST?TICA DE CONTORNOS REGULARES, EXCEPTO A NIVEL ANTEROSUPERIOR, DONDE SE OBSERVO UNA IMAGEN ISOECOGENICA DE ASPECTO NODULAR DE 18MM DE DIAMETRO PROMEDIO QUE PROTRUYE MODERADAMENTE EN LA SILUETA DE LA GLANDULA; CON APARENTE SIMETR?A DE SUS L?BULOS; TEXTURA ECOGR?FICA HOMOG?NEA Y USUAL; DI?METROS (LXTXAP): 42X52X40MM, PARA UN VOLUMEN DE 30CC APROXIMADAMENTE (NORMAL HASTA 20CC).\r\n\r\n\r\nI.DX. \r\n1. RI?ON DERECHO HIPOTROFICO Y DE UBICACION ATIPICA\r\n2. NEFRITIS CRONICA BILATERAL\r\n3. HIDRONEFROSIS BILTERAL GRADO I\r\n4. HIPERTROFIA PROSTATICA GRADO II\r\n5. CISTITIS CRONICA \r\n6. BALON INFLADO DE SONDA, INTRAVESICAL\r\n \r\n \r\n', '2016-10-12 02:21:00'),
