(1, 'E00000000000001', 'ECO OBSTETRICA II-III TRIMESTRE, SOTO', 'ECOGRAFIA OBSTETRICA II-III TRIMESTRE', 'DESCRIPCI?N DEL ESTUDIO: \\nSE PRACTIC? EXPLORACI?N ABDOMINAL CON TRANSDUCTOR CONVEX DE 3.5 MHZ. ENCONTR?NDOSE: LOS SIGUIENTES HALLAZGOS: \\n\\nINFORME: \\nSE REALIZ? ULTRASONOGRAF?A DE I NIVEL ENCONTRANDO FETO ?NICO, VIVO, CEF?LICO, LONGITUDINAL, DORSO IZQUIERDO, CON CR?NEO REGULAR, VENTR?CULOS CEREBRALES DE ASPECTO NORMAL, C?MARA G?STRICA VISIBLE AL IGUAL QUE RI?ONES. / EVALUACI?N LIMITADA POR LA EDAD DE GESTACI?N Y TIPO DE ECOGRAF?A. FRECUENCIA CARD?ACA FETAL DE 157 LATIDOS POR MINUTO.\\n\\nPLACENTA: CORPORAL POSTERIOR ANTERIOR, SIN HEMATOMAS, SIN DESPRENDIMIENTOS, CON GRADO DE MADUREZ I, CON UN ESPESOR DE MM.\\n\\nLIQUIDO AMNI?TICO: CUALITATIVAMENTE NORMAL, LAGO MAYOR/ MANNING: CM. \\n\\nBIOMETRIA FETAL: \\nDI?METRO BIPARIETAL	 MM. SEM D?AS\\nDI?METRO OCCIPITOFRONTAL MM. SEM D?AS \\nCIRCUNFERENCIA CEF?LICA	 MM. SEM D?AS\\nPER?METRO ABDOMINAL	 MM. SEM D?AS\\nLONGITUD FEMORAL	 MM. SEM D?AS\\n\\nSE EVALUARON PAR?METROS DE CRECIMIENTO FETAL ENCONTRANDO CRECIMIENTO SIM?TRICO CON UN PROMEDIO PARA SEMANAS DE GESTACI?N POR BIOMETR?A, CON PESO FETAL ESTIMADO DE GRAMOS POR TABLAS DE HADLOCK.\\n\\nDIAGNOSTICO ULTRASONOGRAFICO:\\n\\n?	GESTACI?N DE SEMANAS D?AS \\n?	FECHA PROBABLE DE PARTO: \\n?	CRECIMIENTO FETAL SIM?TRICO EN PERCENTIL\\n?	PLACENTA CORPORAL POSTERIOR ANTERIOR \\n?	LIQUIDO AMNI?TICO NORMAL \\n\\n\\n\\n\\nANOTACI?N: EN EMBARAZOS DE RIESGO SE DEBE COMPLEMENTAR LA EVALUACI?N DEL BIENESTAR FETAL CON EL PERFIL BIOF?SICO FETAL. ESTA ECOGRAF?A CORRESPONDE A NIVEL I, SE DEBE TENER PRESENTE QUE EN LA GESTACI?N PARA DESCARTARSE LA MAYOR?A DE DEFECTOS ESTRUCTURALES SE DEBE TENER UNA ULTRASONOGRAF?A GEN?TICA SEMANA 11-13.6 Y UNA ULTRASONOGRAF?A DE NIVEL III EN LA SEMANA 18-24. ESTA ECOGRAF?A NO EST? DISE?ADA PARA DETECCI?N DE MALFORMACI?N FETAL.\\n\\nFAVOR CONSERVAR ESTE REPORTE Y LLEVARLO A SU PR?XIMO CONTROL ECOGR?FICO'),
(2, 'E00000000000002', 'ECO OBSTETRICA I TRIMESTRE - SOTO', 'ECOGRAFIA OBSTETRICA I TRIMESTRE', 'DESCRIPCI?N DEL ESTUDIO:\\n\\nSE PRACTIC? EXPLORACI?N VAGINAL CON TRANSDUCTOR INTRACAVITARIO DE 6.5 MHZ. ENCONTR?NDOSE:\\n\\nINFORME:\\n?TERO GESTANTE OCUPADO POR SACO GESTACIONAL INTRAUTERINO, CON EMBRI?N ?NICO, VIVO, ACTIVO CON EMBRIOCARDIA DE LATIDOS POR MINUTO, CON UNA LONGITUD CEFALO CAUDAL DE MM.\\n\\nCOMPATIBLE CON UNA EDAD GESTACIONAL DE SEMANAS D?AS\\n\\nDECIDUA NORMAL, SIN HEMATOMAS, NI DESPRENDIMIENTOS.\\n\\nLIQUIDO AMNI?TICO NORMAL CANTIDAD.\\n\\nCUELLO CON AMBOS ORIFICIOS CERRADOS.\\n\\nANEXOS NORMALES\\n\\nCONCLUSI?N:\\n?	EMBARAZO INTRAUTERINO DE SEMANAS D?AS.\\n?	FPP: \\n?	VITALIDAD EMBRIONARIA AL MOMENTO DEL EXAMEN\\n\\nRECOMENDACIONES: \\n?	SE SUGIERE ECO DE TAMIZAJE GEN?TICO SEMANA 11-13.6 POR MEDICINA MATERNO FETAL\\n\\n\\nAnotaci?n: Esta ecograf?a corresponde a nivel I, se debe tener presente que en la gestaci?n para descartarse la mayor?a de defectos estructurales se debe tener una ultrasonograf?a gen?tica semana 11-13.6 y una ultrasonograf?a de nivel III en la semana 18-24\\n\\nFavor conservar este reporte y llevarlo a su pr?ximo control ecogr?fico'),
(3, 'E00000000000003', 'ECO PELVICA TRANSVAGINAL - SOTO', 'ECOGRAFIA PELVICA TRANSVAGINAL', 'DESCRIPCI?N DEL ESTUDIO:\\nSE PRACTIC? EXPLORACI?N VAGINAL CON TRANSDUCTOR INTRACAVITARIO DE 6.5 MHZ. ENCONTR?NDOSE:\\n\\nEVALUACI?N UTERINA:\\n?	?TERO EN ANTEVERSO FLEXI?N, \\n?	DI?METROS: \\n LONGITUDINAL:	 MM \\n ANTEROPOSTERIOR:	 MM \\n TRANSVERSO:	 MM\\n VOLUMEN CC\\n \\nNO AUMENTADO DE TAMA?O, BORDES REGULARES.\\n\\nMIOMETRIO \\nCON ECOESTRUCTURA HOMOG?NEA Y ECOGENICIDAD NORMAL, NO PRESENCIA DE MIOMAS.\\n\\nENDOMETRIO:\\n?	REGULAR, HOMOG?NEO CON UN ESPESOR DE MM. \\n\\nEVALUACI?N ANEXIAL:\\n?	OVARIO DERECHO: DE X X MM. VOL. CC, NORMAL.\\n?	OVARIO IZQUIERDO: DE X X MM. VOL. CC, NORMAL.\\n\\nFONDO DE SACO DE DOUGLAS:\\n?	LIBRE, SIN PRESENCIA DE L?QUIDO, NO PRESENCIA DE MASAS P?LVICAS.\\n\\nCERVIX:\\n?	DE MM DE LONGITUD, SIN QUISTES DE NABOTH EN SU INTERIOR.\\n\\nOPINI?N: 	\\n?	?TERO Y OVARIOS CON CARACTER?STICAS DE NORMALIDAD\\n\\n\\nFAVOR CONSERVAR ESTE REPORTE Y LLEVARLO A SU PR?XIMO CONTROL ECOGR?FICO'),
(4, 'E00000000000004', 'ECO PELVICA TRANSABDOMINAL - SOTO', 'ECOGRAFIA PELVICA TRANSABDOMINAL', 'DESCRIPCI?N DEL ESTUDIO:\\nSE PRACTIC? EXPLORACI?N ABDOMINAL CON TRANSDUCTOR CONVEX DE 3.5 MHZ. ENCONTR?NDOSE:\\n\\nEVALUACI?N UTERINA:\\n?	?TERO EN ANTEVERSO FLEXI?N, \\n?	DI?METROS: \\n LONGITUDINAL:	 MM \\n ANTEROPOSTERIOR:	MM \\n TRANSVERSO:	 MM\\n VOLUMEN CC\\n \\nNO AUMENTADO DE TAMA?O, BORDES REGULARES.\\n\\nMIOMETRIO \\nCON ECOESTRUCTURA HOMOG?NEA Y ECOGENICIDAD NORMAL, NO PRESENCIA DE MIOMAS.\\n\\nENDOMETRIO:\\n?	REGULAR, HOMOG?NEO CON UN ESPESOR DE MM. \\n\\nEVALUACI?N ANEXIAL:\\n?	OVARIO DERECHO: DE X X MM. VOL. CC, NORMAL.\\n?	OVARIO IZQUIERDO: DE X X MM. VOL. CC, NORMAL.\\n\\nFONDO DE SACO DE DOUGLAS:\\n?	LIBRE, SIN PRESENCIA DE L?QUIDO, NO PRESENCIA DE MASAS P?LVICAS.\\n\\nCERVIX:\\n?	DE MM DE LONGITUD, SIN QUISTES DE NABOTH EN SU INTERIOR.\\n\\nOPINI?N: 	\\n?	?TERO Y OVARIOS CON CARACTER?STICAS DE NORMALIDAD'),
(5, 'E00000000000005', 'CERVICOMETRIA - SOTO', 'ECOGRAFIA TRANSVAGINAL - CERVICOMETRIA', 'SE PRACTICO EXPLORACI?N TRANSVAGINAL CON TRANSDUCTOR INTRACAVITARIO DE 6.5 MHZ. PARA CERVICOMETRIA POR SOLICITUD MEDICA. \\n\\nEMBARAZO DE SEMANAS.\\n\\nINFORME:\\n\\nLONGITUD CERVICAL PROMEDIO 15 MM \\n\\nLONGITUD CERVICAL CON PRESI?N TRANSFUNDICA 16.3 MM \\n\\nNO HAY SIGNOS DE EMBUDIZACION, NO SE OBSERVA SLUDGE A NIVEL DE ORIFICIO CERVICAL INTERNO\\n\\nCABEZA FETAL APOYADA.\\n\\nORIFICIO CERVICAL INTERNO CERRADO\\n\\nORIFICIO CERVICAL EXTERNO CERRADO\\n\\nCONCLUSI?N\\n\\n?	CERVICOMETRIA NORMAL'),
