(25, 'E00000000000025', 'ECO TEJIDOS PARED ABDOMINAL - MS', 'ECOGRAFIA DE TEJIDOS BLANDOS DE PARED ABDOMINAL', 'CON TRANSDUCTOR CONVEX DE ALTA FRECUENCIA DE 7-14 MHZ, SE HACE RASTREO ECOGR?FICO IDENTIFIC?NDOSE:\\n\\nLA PIEL Y EL TEJIDO CELULAR SUBCUT?NEO SE ENCUENTRAN PRESERVADOS, SIN EVIDENCIA DE COLECCIONES NI MASAS A ESTE NIVEL.\\nLAS FASCIAS Y PLANOS MUSCULARES SUBYACENTES SE ENCUENTRAN PRESERVADOS, SIN EVIDENCIA DE ALTERACI?N EN LA L?NEA MEDIA.\\nLOS TRAYECTOS DE LOS M?SCULOS OBL?CUOS Y RECTO ANTERIOR DEL ABD?MEN SON DE ASPECTO ECOGR?FICO NORMAL, SIN EVIDENCIA DE RUPTURAS PARCIALES O COMPLETAS QUE SEAN EVALUABLES POR ECOGRAF?A AL MOMENTO DEL ESTUDIO.\\n\\n\\n\\nCONCLUSI?N:\\nECOGRAFIA DE TEJIDOS BLANDOS DE PARED ABDOMINAL DENTRO DE LIMITES NORMALES.'),
(26, 'E00000000000026', 'ECO MAMARIA - MS', 'ECOGRAFIA MAMARIA BILATERAL', 'EL PATR?N GLANDULAR ES CONGESTIVO EDEMATOSO SEVERO CON ALTERACI?N NODULAR, CON ALGUNOS QUISTES DE 4 MM.\\n\\nNO SE IDENTIFICARON N?DULOS S?LIDOS.\\n\\nLA PIEL, TEJIDO CELULAR SUBCUT?NEO Y PLANOS MUSCULARES SON DE ASPECTO ECOGR?FICO USUAL.\\n\\nNO SE IDENTIFICARON MASAS EN AXILAS.\\n\\n\\n\\nCONCLUSION:\\nI.	CAMBIOS FIBROQUISTICOS, BIRADS II'),
(27, 'E00000000000027', 'ECO DE CADERA - MS', 'ECOGRAFIA DE CADERA', 'SE REALIZA ECOGRAF?A COMPARATIVA DE AMBAS CADERAS EN POSICI?N EST?TICA Y CON MANIOBRAS OBSERVANDO:\\n\\nLOS N?CLEOS EPIFISIARIOS SE OBSERVAN DE MORFOLOG?A Y POSICI?N NORMALES\\n\\nEL CUBRIMIENTO ACETABULAR ES NORMAL\\n\\nNO HAY ALTERACIONES CON LA MANIOBRAS ORTOLANE Y BARLOW.\\n\\n\\nCONCLUSI?N: \\nECOGRAFIA DE CADERA DENTRO DE LIMITES NORMALES.'),
(28, 'E00000000000028', 'ECOGRAFIA DE CUELLO - MS', 'ECOGRAFIA DE CUELLO', 'LA GL?NDULA TIROIDEA ES DE TAMA?O, FORMA, LOCALIZACI?N Y ECOGENICIDAD NORMAL, SIN EVIDENCIA DE LESIONES NODULARES.\\n\\nEL L?BULO TIROIDEO DERECHO MIDE X X MM, VOLUMEN CC.\\nEL L?BULO TIROIDEO IZQUIERDO MIDE X X MM, VOLUMEN CC.\\n\\nEL ?STMO TIENE UN ESPESOR DE 3 MM.\\n\\nLOS VASOS CAROT?DEOS Y YUGULARES SON DE CALIBRE Y TRAYECTORIA NORMAL.\\n\\nNO SE OBSERVAN MASAS EN LOS DIFERENTES COMPARTIMIENTOS DEL CUELLO.\\n\\nNO SE APRECIAN LESIONES DE TIPO VASCULAR.\\n\\nLAS REGIONES SUPRACLAVICULARES SE ENCUENTRAN LIBRES DE MASAS.\\n\\nLAS GL?NDULAS SUBMAXILARES SON DE ECOGENICIDAD HOMOG?NEA.\\n\\n\\n\\nCONCLUSI?N:\\nECOGRAF?A DE CUELLO DENTRO DE L?MITES NORMALES.\\n'),
