(30, 'E00000000000030', 'ECO DE HOMBRO - MS', 'ECOGRAFIA ARTICULAR DE HOMBRO', 'POR MEDIO DE UN TRANSDUCTOR MULTIFRECUENCIA DE ANCHO DE BANDA DE 6-12 MHZ SE REALIZA ECOGRAF?A DE TEJIDOS BLANDOS DE HOMBRO, IDENTIFIC?NDOSE: \\n\\nEL TEND?N DEL B?CEPS EN EL INTERIOR DE LA CORREDERA BICIPITAL DE DI?METRO USUAL, SIN L?QUIDO EN LA VAINA TENDINOSA. LA CORREDERA BICIPITAL MUESTRA UNA PROFUNDIDAD NORMAL SIN ALTERACI?N DE SUS CONTORNOS.\\n\\nEL TEND?N DEL SUPRAESPINOSO SUBESCAPULAR E INFRAESPINOSO SON DE ECOESTRUCTURA HOMOG?NEA, SIN DISCONTINUIDAD DE SUS FIBRAS, CON PRESERVACI?N DE SU PATR?N LAMINAR.\\n\\nLA ARTICULACI?N ACROMIOCLAVICULAR SE ENCUENTRA PRESERVADA, CON UN ESPACIO SUBACROMIAL ADECUADO.\\n\\nNO HAY L?QUIDO EN LA BURSA SUBACROMIODELTOIDEA.\\n\\nSE IDENTIFICA EL ASPECTO P?STERO-SUPERIOR DEL LABRUM GLENOIDEO EL CUAL ES HIPEREC?GENO, HOMOG?NEO, DE FORMA TRIANGULAR.\\n\\n\\nCONCLUSI?N:\\nECOGRAF?A DE HOMBRO DENTRO DE L?MITES NORMALES.\\n'),
(31, 'E00000000000031', 'ECO DE RODILLA - MS', 'ECOGRAFIA DE RODILLA', 'POR MEDIO DE UN TRANSDUCTOR MULTIFRECUENCIA DE ANCHO DE BANDA DE 7-14 MHZ, SE REALIZA ECOGRAF?A DE TEJIDOS BLANDOS DE RODILLA ----------- IDENTIFIC?NDOSE: \\n\\nEL TEND?N PATELAR Y EL CU?DRICEPS LOS CUALES MUESTRA UN PATR?N LAMINAR NORMAL.\\n\\nLOS RETIN?CULOS PATELOFEMORALES SE ENCUENTRAN PRESERVADOS.\\n\\nEL LIGAMENTO COLATERAL MEDIAL Y LATERAL NO MUESTRA ANOMAL?AS.\\n\\nEL TEND?N DEL B?CEPS FEMORAL AS? COMO LOS TENDONES QUE CONFORMAN LA PATA DE GANSO NO PRESENTAN ALTERACIONES.\\n\\nNO SE APRECIA L?QUIDO EN LA BURSA SUPRA, INFRA O PREPATELAR.\\n\\nEN EL COMPARTIMENTO POSTERIOR DE LA RODILLA HAY INTEGRIDAD DE LA C?PSULA POSTERIOR.\\n\\nCONCLUSI?N:\\nECOGRAF?A DE TEJIDOS BLANDOS DE RODILLA DENTRO DE L?MITES NORMALES.\\n'),
