(34, 'E00000000000034', 'ECO TRANSFONTANELAR - MS', 'ECOGRAFIA TRANSFONTANELAR', 'SE PRACTICA ESTUDIO EN TIEMPO REAL CON TRANSDUCTOR DE 7.5 MHZ IDENTIFICANDO LO SIGUIENTES DATOS:\\n\\nSE REALIZARON CORTES CORONALES Y SAGITALES A TRAV?S DE LA FONTANELA ANTERIOR, SIN EVIDENCIA DE IM?GENES HIPO E HIPERECOICOS AN?MALAS, CORTICO SUBCORTICALES QUE SUGIERAN ?REAS DE HEMORRAGIAS O QU?STICAS.\\n\\nLOS CORTES CORONALES PERMITEN LA LOCALIZACI?N ADECUADA DEL ESPACIO SUBARACNOIDEO BIFRONTAL SIN ALTERACIONES; HOZ DEL CEREBRO ECOGENICA; ASTAS FRONTALES DE LOS VENTR?CULOS LATERALES DE CONTENIDO ANECOICO Y SIN DILATACI?N, \\nVASCULARIZACI?N DE AMBAS CABEZAS CAUDADAS SIN PRESENCIA DE HEMORRAGIAS TRANSEPENDIMARIA; SISTEMA VENTRICULAR SUPRA E INFRATENTORIAL SIN ALTERACIONES.\\n\\nEN LOS CORTES SAGIALES SE IDENTIFICA TRAYECTO DEL CUERPO CALLOSO, TALAMOS, TERCER Y CUARTO VENTR?CULO\\nACUEDUCTO DE SILVIO, CEREBELO, CISTERNA MAGNA Y TALLO CEREBRAL DE CARACTER?STICAS NORMALES Y ECOGENICIDAD CONSERVADA.\\n	\\n\\nOPINI?N:\\nULTRASONOGRAF?A TRANSFONTANELAR SIN HALLAZGOS RELEVANTES AL MOMENTO DE LA INTERPRETACI?N.\\nSE SUGIERE TAC CEREBRAL COMPLEMENTARIO.\\nFAVOR ANEXAR EL PRESENTE ESTUDIO AL MOMENTO DE LA REALIZACI?N DE ESTE.\\nCORRELACIONAR CON CL?NICA.\\n'),
(35, 'E00000000000035', 'DOPPLER VENOSO DERECHO - MS', 'DOPPLER DUPLEX VENOSO DE MIEMBRO INFERIOR DERECHO', 'EXISTE ADECUADA Y F?CIL COLAPSABILIDAD DE LOS DIFERENTES SEGMENTOS VENOSOS, TANTO SUPERFICIALES COMO PROFUNDOS DEL MIEMBRO INFERIOR, SIN EVIDENCIA DE TROMBOS EN SU INTERIOR, NI ENGROSAMIENTO DE SU PARED.\\n\\nEN EL SISTEMA VENOSO PROFUNDO, NO SE APRECIA REFLUJO CON LAS MANIOBRAS DE VALSALVA NI CON LA COMPESI?N DISTAL, A NIVEL DE VENA FEMORAL COM?N, VENA FEMORAL, VENA FEMORAL PROFUNDA, VENA POPL?TEA, VENA TRONCO TIBIO PERONEO Y LAS VENAS TIBIALES, SIENDO LA ONDA DE FLUJO SINCR?NICA CON LA RESPIRACI?N.\\n\\nS?LEAS Y SURALES COMPRESIBLES, COLAPSABLES Y DISTENSIBLES.\\n\\nEL DI?METRO DE LA UNI?N SAFENO FEMORAL ES DE ___ MM, EN SU SEGMENTO MEDIO DE __ MMS Y EN SU SEGMENTO DISTAL DE___ MMS.\\n\\nEL DI?METRO DE LA UNI?N SAFENO POPL?TEA ES DE ___ MMS.\\n\\nLA SAFENA MAYOR Y MENOR EST?N PERMEABLES, COMPRESIBLES, COLAPSABLES, CON ONDAS DE FLUJO SINCR?NICAS CON LA RESPIRACI?N, SIN EVIDENCIA DE REFLUJO CON LA INSPIRACI?N PROFUNDA, CON LAS MANIOBRAS DE VALSALVA NI CON LA COMPRESI?N DISTAL.\\nNO SE IDENTIFICAN PERFORANTES INCOMPETENTES.\\n\\n\\nOPINION: \\nI.	ECO DOPPLER DE MIEMBRO INFERIOR DERECHO DENTRO DE LIMITES NORMALES.\\nII.	ESTUDIO NEGATIVO PARA TROMBOSIS VENOSOS SUPERFICIAL Y/O PROFUNDO.\\n'),
(36, 'E00000000000036', 'DOPPLER VENOSO IZQ - MS', 'DOPPLER DUPLEX VENOSO DE MIEMBRO INFERIOR IZQUIERDO ', 'EXISTE ADECUADA Y F?CIL COLAPSABILIDAD DE LOS DIFERENTES SEGMENTOS VENOSOS, TANTO SUPERFICIALES COMO PROFUNDOS DEL MIEMBRO INFERIOR, SIN EVIDENCIA DE TROMBOS EN SU INTERIOR, NI ENGROSAMIENTO DE SU PARED.\\n\\nEN EL SISTEMA VENOSO PROFUNDO, NO SE APRECIA REFLUJO CON LAS MANIOBRAS DE VALSALVA NI CON LA COMPESI?N DISTAL, A NIVEL DE VENA FEMORAL COM?N, VENA FEMORAL, VENA FEMORAL PROFUNDA, VENA POPL?TEA, VENA TRONCO TIBIO PERONEO Y LAS VENAS TIBIALES, SIENDO LA ONDA DE FLUJO SINCR?NICA CON LA RESPIRACI?N.\\n\\nS?LEAS Y SURALES COMPRESIBLES, COLAPSABLES Y DISTENSIBLES.\\n\\nEL DI?METRO DE LA UNI?N SAFENO FEMORAL ES DE ____ MM, EN SU SEGMENTO MEDIO DE ___ MMS Y EN SU SEGMENTO DISTAL DE __MMS.\\n\\nEL DI?METRO DE LA UNI?N SAFENO POPL?TEA ES DE ___ MMS.\\n\\nLA SAFENA MAYOR Y MENOR EST?N PERMEABLES, COMPRESIBLES, COLAPSABLES, CON ONDAS DE FLUJO SINCR?NICAS CON LA RESPIRACI?N, SIN EVIDENCIA DE REFLUJO CON LA INSPIRACI?N PROFUNDA, CON LAS MANIOBRAS DE VALSALVA NI CON LA COMPRESI?N DISTAL.\\nNO SE IDENTIFICAN PERFORANTES INCOMPETENTES.\\n\\n\\nOPINION: \\nI.	DOPPLER DE MIEMBRO INFERIOR IZQUIERDO DENTRO DE L?MITES NORMALES.\\nII.	ESTUDIO NEGATIVO PARA TROMBOSIS VENOSOS SUPERFICIAL Y/O PROFUNDO.\\n\\n'),
(37, 'E00000000000037', 'DOPPLER ARTERIAL - MS', 'DOPPLER DUPLEX ARTERIAL DE MIEMBRO INFERIOR DERECHO', 'T?CNICA: POR MEDIO DE UN TRANSDUCTOR MULTIFRECUENCIA DE ANCHO DE 4-7 MHZ SE REALIZAN MEDICIONES DOPPLER COLOR DE LOS DIFERENTES SEGMENTOS ARTERIALES DEL MIEMBRO INFERIOR DERECHO.\\n\\nRESULTADOS:\\n\\nSE IDENTIFICARON ADECUADAMENTE LOS DIFERENTES SEGMENTOS ARTERIALES DE LOS MIEMBROS INFERIORES, VISUALIZ?NDOSE UN FLUJO DE TIPO TRIF?SICO NORMAL EN TODOS LOS SEGMENTOS, SIN EVIDENCIA DE AUMENTOS FOCALIZADOS DE LAS VELOCIDADES SIST?LICAS QUE SUGIERAN ESTENOSIS HEMODIN?MICAMENTE SIGNIFICATIVAS.\\n\\nNO SE VISUALIZARON PLACAS DE ATEROMA, NI ESTRECHECES EN EL DI?METRO DE LOS VASOS. EL FLUJO HACIA EL LECHO VASCULAR DISTAL ES DE TIPO TRIF?SICO NORMAL.\\n\\nCONCLUSION:\\nECO DOPPLER COLOR TRIPLEX ARTERIAL DE MIEMBROS INFERIORES DENTRO DE L?MITES NORMALES.'),
(38, 'E00000000000038', 'DOPPLER ARTERIAL IZQ - MS', 'DOPPLER DUPLEX ARTERIAL DE MIEMBRO INFERIOR IZQUIERDO', 'T?CNICA: POR MEDIO DE UN TRANSDUCTOR MULTIFRECUENCIA DE ANCHO DE 4-7 MHZ SE REALIZAN MEDICIONES DOPPLER COLOR DE LOS DIFERENTES SEGMENTOS ARTERIALES DEL MIEMBRO INFERIOR IZQUIERDO.\\n\\nRESULTADOS:\\n\\nSE IDENTIFICARON ADECUADAMENTE LOS DIFERENTES SEGMENTOS ARTERIALES DE LOS MIEMBROS INFERIORES, VISUALIZ?NDOSE UN FLUJO DE TIPO TRIF?SICO NORMAL EN TODOS LOS SEGMENTOS, SIN EVIDENCIA DE AUMENTOS FOCALIZADOS DE LAS VELOCIDADES SIST?LICAS QUE SUGIERAN ESTENOSIS HEMODIN?MICAMENTE SIGNIFICATIVAS.\\n\\nNO SE VISUALIZARON PLACAS DE ATEROMA, NI ESTRECHECES EN EL DI?METRO DE LOS VASOS. EL FLUJO HACIA EL LECHO VASCULAR DISTAL ES DE TIPO TRIF?SICO NORMAL.\\n\\n\\nCONCLUSI?N:\\nECO DOPPLER COLOR TRIPLEX ARTERIAL DE MIEMBROS INFERIORES DENTRO DE L?MITES NORMALES.\\n'),
(39, 'E00000000000039', 'ECO OBSTETRICA I - MS', 'ECOGRAFIA OBSTETRICA I TRIMESTRE', 'SE APRECIA SACO GESTACIONAL DE 48 MM, QUE CORRESPONDE A 8 SEMANAS O D?AS, CON DI?METRO C?FALO CAUDAL DE 19 MM, CORRESPONDIENTE A 8 SEMANAS 3 D?AS, CON EMBRI?N EN SU INTERIOR Y FRECUENCIA CARD?ACA POSITIVA DE 171 LATIDOS POR MINUTO, PRESENCIA DE SACO VITELINO DE MM.\\n\\nL?QUIDO AMNI?TICO DE CANTIDAD SUBJETIVAMENTE HABITUAL.\\n\\nTROFOBOLASTRO SIN EVIDENCIA DE HEMATOMAS SUBCORIONICOS.\\n\\nLOS RECESOS DE L?QUIDO AMNI?TICO SON DE CANTIDAD Y CALIDAD HABITUAL.\\n\\nAMBOS OVARIOS SON DE FORMA TAMA?O HABITUAL, EL DERECHO DE X MM CONSERVADO Y EL IZQUIERDO DE X MM.\\n\\nREGIONES ANEXIALES LIBRES DE COLECCI?N.\\n\\nFONDO DE SACO DE DOUGLAS LIBRE.\\n\\nEL ORIFICIO CERVICAL INTERNO SE ENCUENTRA CERRADO.\\n\\n\\n\\nCONCLUSI?N:\\nI.	EMBARAZO INTRAUTERINO CON FETO ?NICO VIVO DE 8 SEMANAS D?AS 3 POR BIOMETR?A FETAL. CLR\\nII.	FPP: \\n'),
(40, 'E00000000000040', 'ECO OBSTETREICA II-III - MS', 'ECOGRAFIA OBSTETRICA II-III TRIMESTRE', 'SE APRECIA EMBARAZO INTRAUTERINO CON FETO ?NICO VIVO, EN SITUACI?N LONGITUDINAL, PRESENTACI?N CEF?LICA, DORSO DERECHO.\\n\\nEL DI?METRO BIPARIETAL DE CMS CORRESPONDE A SEMANAS D?AS. \\nLA CIRCUNFERENCIA CEF?LICA DE CMS CORRESPONDE A SEMANAS D?AS. \\nLA CIRCUNFERENCIA ABDOMINAL DE CMS CORRESPONDE A SEMANAS D?AS. \\nLA LONGITUD FEMORAL DE CMS CORRESPONDE A SEMANAS D?AS. \\n\\nTONO Y MOVIMIENTOS FETALES CONSERVADOS.\\n\\nCORAZ?N DE CUATRO CAVIDADES NORMOCONFIGURADO, CON FRECUENCIA CARD?ACA FETAL DE LATIDOS POR MINUTO.\\n\\nLA PLACENTA SE ENCUENTRA EN IMPLANTACI?N CON UN GRADO DE MADURACI?N ACORDE A LA EDAD GESTACIONAL.\\n\\nLOS RECESOS DE L?QUIDO AMNI?TICO SON DE CANTIDAD Y CALIDAD HABITUAL.\\n\\nEL ORIFICIO CERVICAL INTERNO SE ENCUENTRA CERRADO.\\n\\n\\nCONCLUSI?N:\\nI.	EMBARAZO INTRAUTERINO CON FETO ?NICO VIVO DE SEMANAS D?AS POR BIOMETR?A FETAL.\\nII.	PESO FETAL APROXIMADO GRS.\\nIII.	FPP: \\n'),
(41, 'E00000000000041', 'ECO PELVICA TRANSVAGINAL - MS', 'ECOGRAFIA PELVICA TRANSVAGINAL', 'SE IDENTIFICA EL ?TERO EN LA L?NEA MEDIA, EN ANTEVERSI?N, DE TAMA?O, CONTORNOS Y ECOESTRUCTURA NORMAL, PAR?NQUIMA HOMOG?NEO, MIDE _______, CON UN ECO MEDIO ENDOMETRIAL DE _____ CMS.\\n\\nLOS OVARIOS SON DE FORMA Y TAMA?O NORMAL, EL DERECHO MIDE ______ CMS Y EL IZQUIERDO ______ CMS.\\n\\nNO SE OBSERVA L?QUIDO LIBRE EN EL FONDO DE SACO, AS? COMO TAMPOCO MASAS ANEXIALES, NI COLECCIONES.\\n\\n\\n\\nCONCLUSI?N:\\nECOGRAF?A P?LVICA TRANSVAGINAL DENTRO DE L?MITES NORMALES.\\n'),
(42, 'E00000000000042', 'DOPPLER CAROTIDEO - MS', 'ECOGRAFIA DOPPLER CAROTIDEO', 'T?CNICA: POR MEDIO DE UN TRANSDUCTOR MULTIFRECUENCIA DE ANCHO DE BANDA DE 5-12 MHZ SE REALIZA ECOGRAF?A DOPPLER TRIPLEX DE VASOS DE CUELLO.\\n\\nRESULTADOS:\\n\\nSE IDENTIFICA ADECUADAMENTE LA ARTERIA CAR?TIDA COM?N, BULBO CAROT?DEO, CAR?TIDA INTERNA, CAR?TIDA EXTERNA Y ARTERIA VERTEBRAL EN TODO SU TRAYECTO.\\n\\nNO SE EVIDENCIAN PLACAS DE ATEROMA CALCIFICADAS NI ALTERACIONES DE LA ECOGENICIDAD DE LAS PAREDES ARTERIALES QUE SUGIERAN LA PRESENCIA DE ULCERACIONES O SANGRADO. \\n\\nHAY CONTINUIDAD DE LAS PAREDES DE LOS VASOS, SIN P?RDIDA DEL PARALELISMO DE SUS BORDES.\\n\\nLAS ONDAS ESPECTRAL DOPPLER MEDIDAS A NIVEL DE LA ARTERIA CAR?TIDA COM?N, BULBO CAROT?DEO, CAR?TIDA INTERNA, CAR?TIDA EXTERNA Y ARTERIA VERTEBRAL SON DE TIPO MONOF?SICO NORMAL PARA LOS DIFERENTES SEGMENTOS ANALIZADOS, SIN ZONAS DE AUMENTOS FOCALIZADOS DE LAS VELOCIDADES SIST?LICAS QUE SUGIERAN ESTENOSIS HEMODIN?MICAMENTE SIGNIFICATIVA.\\n\\nHAY FLUJO ANTER?GRADO NORMAL EN LAS ARTERIAS VERTEBRALES.\\n\\n\\nCONCLUSI?N:\\nI. DOPPLER TRIPLEX DE VASOS DEL CUELLO DENTRO DE L?MITES NORMALES.\\n\\n'),
(43, 'E00000000000043', 'ECO DE PROSTATA - MS', 'ECOGRAFIA DE PROSTATA', 'LA VEJIGA ES DE LLENADO HOMOG?NEO, SIN EVIDENCIA DE LESIONES ENDOLUMINALES NI ENGROSAMIENTO DE LA PARED.\\n\\n\\nPR?STATA HOMOG?NEA CON UN DI?METRO DE X X , PARA UN PESO DE GR.\\n\\n\\n\\nCONCLUSI?N:\\nECOGRAFIA DE PR?STATA DENTRO DE L?MITES NORMALES.\\n\\n'),
(44, 'E00000000000044', 'ECO OBSTETRICA I TRIMESTRE - NELSON', 'ECOGRAFIA OBSTETRICA I TRIMESTRE', 'SE PRACTIC? EXPLORACI?N VAGINAL CON TRANSDUCTOR INTRACAVITARIO DE 6.5 MHZ. ENCONTR?NDOSE:\\n\\nCUELLO: DE X MM\\n\\n?TERO: EN AVF\\n\\nLONGITUDINAL: MM\\n\\nANTEROPOSTERIOR: MM\\n\\nTRANSVERSO: MM\\n\\nSACO GESTACIONAL: ?NICO, DE MM DE DI?METRO PROMEDIO, BORDES REGULARES, BUENA REACCI?N DECIDUAL, SIN ZONAS DE DESPRENDIMIENTOS O HEMATOMAS. \\n\\nVES?CULA VITELINA: PRESENTE, DE ASPECTO NORMAL, DE MM.\\n\\nEMBRI?N/FETO: ?NICO, EMBRIOCARDIA POSITIVA, 156 LAT. /MIN. CON CRL: MM.\\n\\nFPP:\\n\\nDX: EMBARAZO DE SEM. POR CRL.\\n\\n\\nECOGRAFIA OBSTETRICA CONTRATADA Y REALIZADA DE PRIMER NIVEL (BASICA), SOLO PUEDE DETECTAR MENOS DEL 55 % DE LAS ANOMALIAS EMBRIONARIAS O FETALES.'),
(45, 'E00000000000045', 'ECO OBSTETRICIA - NELSON', 'ECOGRAFIA OBSTETRICA II - III TRIMESTRE', 'DESCRIPCI?N DEL ESTUDIO: SE PRACTIC? EXPLORACI?N ABDOMINAL CON TRANSDUCTOR CONVEX DE 3.5 MHZ. ENCONTR?NDOSE: ?TERO GR?VIDO CON FETO: ?NICO, VIVO, CEF?LICO, LONGITUDINAL IZQUIERDO, CON MOVIMIENTOS ESPONT?NEOS PRESENTES Y FCF 144 X?.\\n\\nBIOMETR?A FETAL:\\nD.B.P: MM. PARA: SEMANAS.\\nHC: MM. PARA: SEMANAS. \\nAC: MM. PARA: SEMANAS.\\nFL: MM. PARA: SEMANAS.\\n\\nPESO FETAL ESTIMADO: GRS. +/- 10%\\n\\nPLACENTA: IMPLANTACI?N GRADO I/III A M?S DE 20 MM DEL OCI, SIN HEMATOMAS RETROCORIALES NI DESPRENDIMIENTOS PLACENTARIOS HASTA EL MOMENTO. \\n\\nCORD?N UMBILICAL: CON TRES ELEMENTOS VASCULARES. \\n\\nL?QUIDO AMNI?TICO: NORMAL EN ASPECTO Y CANTIDAD. \\n\\nFPP:\\n\\nIMPRESI?N DIAGNOSTICA ECOGR?FICA: EMBARAZO DE SEM POR BIOMETR?A FETAL.\\n\\nCOMENTARIOS: \\nECOGRAFIA OBSTETRICA CONTRATADA Y REALIZADA DE PRIMER NIVEL (BASICA), SOLO PUEDE DETECTAR MENOS DEL 55 % DE LAS ANOMALIAS ESTRUCTURALES FETALES.\\nIMPORTANTE: LA PRECISI?N ECOGR?FICA DEPENDE DE LA EDAD GESTACIONAL (M?S FIABLE A LAS 20 SEMANAS CON ECOGRAF?A DETALLADA) DEL TIPO DE ANOMAL?AS (ALGUNAS TIENEN POCA O NULA EXPRESI?N ECOGR?FICA) LAS CONDICIONES DE LA GESTANTE (OBESIDAD, L?QUIDO AMNI?TICO, DISPOSICI?N ETC.) Y DE LA PROPIA POSICI?N DEL FETO LA TASA DE DETECCI?N ESTA ENTRE 18 Y 85 % MEDIA DE 56 % EN CONDICIONES ?PTIMAS. \\n- LA ECOGRAF?A SOLO PUEDE INFORMAR DE LA EXISTENCIA DE POSIBLES ANOMAL?AS F?SICAS Y NO DE DEFECTOS CONG?NITOS DE OTRA NATURALEZA, POR LO TANTO UNA ECOGRAF?A CON RESULTADOS NORMALES NO GARANTIZA QUE EN PRODUCTO DE LA CONCEPCI?N NAZCA SIN ALTERACIONES F?SICAS O MENTALES.\\n- EN ALGUNOS CASOS, LA DETECCI?N DE UNA ANOMAL?A SER? FORZOSAMENTE TARD?A (INFECCIONES FETALES, ALGUNAS ANOMAL?AS DIGESTIVAS, OBSTRUCCIONES URINARIAS E INTESTINALES, TRASTORNOS DEL DESARROLLO DEL ESQUELETO, ETC.), DADO QUE TALES PATOLOG?AS SE ORIGINAN O MANIFIESTAN EN UNA ETAPA AVANZADA DE LA GESTACI?N.\\n1. GRANDJEAN H. LARROQUE D. LEVI S. THE PERFOMANCE OF ROUTINE ULTRASONOGRAPHIC SCREENING OF PRENANCIES IN THE EUROFETUS STUDY.\\nAMERICAN JOURNAL OF OBSTETRICS AND GYNECOLOGYS, VOLUMEN 181 ? ISSUS 2 (AUGUST 1999).\\n2. STOLL C. TENCONI R, CLEMENTI M. DETECCION OF CONGENITAL ANOMALIES BY FETAL ULTRASONOGRAPHIC.\\n3. STOLL C. GARNE E. EUROSCAN STUDY GROUP. EVALUATION OF PRENATAL DIAGNOSIS OF ASSOCIATED CONGENITAL HEART DISEASES BY FETAL ULTRASONOGRAPHIC EXAMINATION IN EUROPE. PRENATAL DIAGN. 2001. APRIL 21 (4) 243 ? 252.\\n4. GARENE E. LOANE M. DOLK H. ET AL. PRENATAL DIAGNOSIS OF SEVER STRUCTURAL CONGENITAL MALFORMATIONS IN EUROPE. ULTRASOUND OBSTET GYNECOL 2005, JAN, 25 (1) 6 ? 11.'),
(46, 'E00000000000046', 'ECO PELVICA TV - NELSON', 'ECOGRAFIA PELVICA TRASNVAGINAL', 'SE PRACTIC? EXPLORACI?N POR V?A VAGINAL CON TRANSDUCTOR INTRACAVITARIO DE 6.5 MHZ. ENCONTR?NDOSE:\\n\\nCUELLO: X MM\\n\\n?TERO: AVF\\n\\nLONG: MM\\n\\nANTEROPOSTERIOR: MM\\n\\nTRANSVERSO: MM\\n\\nMIOMETRIO: HOMOG?NEO.\\n\\nENDOMETRIO: MM DE DI?METRO \\n\\nOVARIO DERECHO: CON MEDIDAS DE X X MM \\n\\nOVARIO IZQUIERDO: CON MEDIDAS DE X X MM \\n\\nIDX:\\nECOGRAFIA PELVICA TRANSVAGINAL DENTRO DE LIMITES NORMALES.\\n'),
