(48, 'E00000000000048', 'PELVICA CON ANALISIS DOPPLER - MS', 'ULTRASONOGRAFIA PELVICA CON AN?LISIS DOPPLER ACR', 'DESCRIPCION DEL ESTUDIO: SE PRACTICO EXPLORACION PELVICA POR VIA ABDOMINAL CON TRANSDUCTOR CONVEX DE 3.5 MHZ. \\n\\nCUELLO: DE X MM.\\n\\nUTERO: AVF\\n\\nLONG: MM.\\n\\nANTEROPOSTERIOR: MM.\\n\\nTRANSVERSO: MM.\\n\\nMIOMETRIO:\\n\\nENDOMETRIO: MM DE DIAMETRO.\\n\\nOVARIO DERECHO: CON MEDIDAS DE X X MM.\\n\\nOVARIO IZQUIERDO: CON MEDIDAS DE X X MM.\\n\\nIDX:\\nECOGRAFIA PELVICA TRANSABDOMINAL DENTRO DE LIMITES NORMALES.');
