(13, 'L00000000000013', 'TAC CEREBRO CON CONTRASTE', 'TC DE CEREBRO CON CONTRASTE', 'CORTES AXIALES DESDE BASE A BOVEDA CRANEAL CON LA ADMINISTRACION DE CONTRASTE ENDOVENOSO, REVELAN:\\n\\nPARONQUIMA ENCEFALICO TANTO INFRA COMO SUPRATENTORIAL SIN EVIDENCIA DE LESIONES OCUPANTES DE ESPACIO, HEMORRAGIAS O COLECCIONES.\\nCISTERNAS BASALES Y SURCOS CORTICALES SIN ALTERACIONES.\\nSISTEMA VENTRICULAR EN LINEA MEDIA SIN DILATACIONES NI DESPLAZAMIENTOS.\\nREGI?N SELAR, PARASELAR OCULAR Y RETRO-OCULAR SIN LESIONES APARENTES.\\nTALLO CEREBRAL DENTRO DE LA NORMALIDAD.\\nESTRUCTURAS ?SEAS VISUALIZADAS DE ASPECTO NORMAL. \\nNO SE OBSERVARON TINCIONES ANORMALES LUEGO DE ADMINISTRADO EL CONTRASTE ENDOVENOSO.\\n\\nIMPRESION DIAGNOSTICA:\\n\\nSIN EVIDENCIA DE LESIONES EXPANSIVAS INTRA-CRANEALES.'),
(14, 'L00000000000014', 'TAC DE ABDOMEN SIMPLE', 'TC DE ABDOMEN', 'ESTUDIO EFECTUADO SEGUN PROTOCOLOS DE LA INSTITUCION REVELAN:\\n\\n\\nH?GADO, P?NCREAS Y BAZO DE TAMA?O Y DENSIDAD NORMAL, SIN EVIDENCIA DE LESIONES FOCALES.\\nAMBOS RI?ONES DE TAMA?O, POSICI?N Y CONFIGURACION NORMAL, MOSTRANDO ADECUADA ELIMINACION DE CONTRASTE ENDOVENOSO, SIN DILATACIIN DE SISTEMAS COLECTORES.\\nNO SE DEFINEN COLECCIONES LIQUIDAS NI A?REAS INTRA-ABDOMINALES.\\nNO SE OBSERVAN DILATACIONES DE ASAS INTESTINALES EN TRAYECTO COLONICO.\\nRETROPERITONEO LIBRE DE MASAS Y ADENOPATIAS.\\nAORTA Y GRANDES VASOS EN LINEA MEDIA DE CALIBRE NORMAL.\\n\\n\\nIMPRESION DIAGNOSTICA:\\n\\n?	SIN ALTERACIONES TOMOGR?FICAS APARENTES.'),
(15, 'L00000000000015', 'TAC DE CRANEO SIMPLE', 'TC DE CEREBRO', 'CORTES AXIALES DESDE BASE A B?VEDA CRANEAL SIN LA ADMINISTRACI?N DE CONTRASTE ENDOVENOSO, REVELAN:\\n\\n\\nPAR?NQUIMA ENCEF?LICO TANTO INFRA COMO SUPRATENTORIAL SIN EVIDENCIA DE LESIONES OCUPANTES DE ESPACIO, HEMORRAGIAS O COLECCIONES.\\nCISTERNAS BASALES Y SURCOS CORTICALES SIN ALTERACIONES.\\nSISTEMA VENTRICULAR EN L?NEA MEDIA SIN DILATACIONES NI DESPLAZAMIENTOS.\\nREGI?N SELAR, PARASELAR OCULAR Y RETRO-OCULAR SIN LESIONES APARENTES.\\nTALLO CEREBRAL DENTRO DE LA NORMALIDAD.\\nESTRUCTURAS ?SEAS VISUALIZADAS DE ASPECTO NORMAL. \\n\\nIMPRESION DIAGNOSTICA:\\n\\n?	SIN EVIDENCIA DE LESIONES EXPANSIVAS INTRA-CRANEALES.'),
(16, 'L00000000000016', 'TAC HIGADO TRIFASICO', 'TC DE HIGADO TRIFASICO', 'ESTUDIO EFECTUADO SEG?N PROTOCOLOS DE LA INSTITUCI?N REVELAN:\\n\\n\\nH?GADO DE TAMA?O NORMAL, PAR?NQUIMA HOMOG?NEO, SIN LESIONES FOCALES.\\nNO SE EVIDENCIA DILATACI?N DE V?AS BILIARES INTRA O EXTRAHEP?TICAS.\\nP?NCREAS Y BAZO PRESENTAN PAR?NQUIMA HOMOG?NEO SIN ALTERACIONES.\\nGL?NDULAS ADRENALES DE ASPECTO NORMAL.\\nAMBOS RI?ONES SIN DILATACI?N DE SISTEMAS COLECTORES, NI HALLAZGOS SUGESTIVOS DE LITIASIS O LESIONES CORTICALES.\\nASAS INTESTINALES EVALUADAS SIN HALLAZGOS PATOL?GICOS.\\nNO SE EVIDENCIA L?QUIDO LIBRE O ADENOMEGALIAS.\\nTRONCO CELIACO DE CONFIGURACI?N NORMAL, SIN EVIDENCIA DE ALTERACIONES.\\nVENA PORTA DE TAMA?O Y CONFIGURACI?N NORMAL.\\nESTRUCTURAS ?SEAS EVALUADAS SIN ALTERACIONES.\\n\\nIMPRESI?N DIAGN?STICA:\\n\\n?	ESTUDIO TOMOGR?FICO SIN HALLAZGOS PATOL?GICOS.'),
(17, 'L00000000000017', 'TC CUELLO', 'TC DE CUELLO', 'CORTES AXIALES, PORCIONES SUPERIORES A INFERIORES DE CUELLO SIN LA ADMINISTRACI?N DE CONTRASTE ENDOVENOSO, REVELAN:\\n\\n\\nCOMPARTIMIENTOS CERVICALES ANTERIORES, POSTERIORES Y LATERALES LUCEN DE ASPECTO NORMAL, SIN DEFINIRSE EN LAS MISMAS LESIONES DE ASPECTO INFILTRATIVO.\\nNO HAY ALTERACIONES EN DI?METRO DE COLUMNA A?REA Y V?AS RESPIRATORIAS SUPERIORES.\\nNO HAY MASAS O ADENOPAT?AS EN CADENAS GANGLIONARES CERVICALES.\\nREGI?N CAROTIDEA, PAROTIDEA SIN ALTERACIONES.\\nESTRUCTURAS ?SEAS, BLANDAS Y VASCULARES LUCEN DE ASPECTO NORMAL.\\n\\nIMPRESI?N DIAGN?STICA:\\n\\n?	ESTUDIO TOMOGR?FICO DE CUELLO SIN LESIONES APARENTES.'),
(18, 'L00000000000018', 'TC PELVIS', 'TC PELVIS', 'ESTUDIO EFECTUADO SEG?N PROTOCOLOS DE LA INSTITUCI?N REVELAN:\\n\\n\\nVEJIGA URINARIA DE TAMA?O, FORMA Y POSICI?N NORMAL SIN DENSIDADES FOCALES ANORMALES.\\nPAREDES RECTALES LUCEN FINAS SIN CAMBIOS EN LA DENSIDAD DE LA GRASA PERIRECTAL.\\nNO SE VISUALIZARON IM?GENES NODULARES COMPATIBLES CON ADENOPAT?AS INGUINALES, P?LVICAS NI EN CADENAS ILIACAS PROFUNDAS.\\nNO SE OBSERVAN COLECCIONES LIQUIDAS NI A?REAS N CAVIDAD P?LVICA.\\nFOSAS ISQUIORECTALES LIBRES.	\\nESTRUCTURAS ?SEAS SIN ALTERACIONES.\\n\\n\\nIMPRESI?N DIAGN?STICA:\\n\\n?	ESTUDIO DENTRO DE L?MITES NORMALES.');
